import { useFormik } from "formik";
import { useNavigate, useParams } from "react-router-dom";
import MovieService from "../service/MovieService";


export default function UpdatePage(){
  const{id}=useParams();
  const navigate = useNavigate();

const formik = useFormik({
  initialValues: {
      id: parseInt(id!),
    Title: "",
    ReleaseDate: "",
  },
  onSubmit: (values) => {
    handleSubmit(parseInt(id!),values.Title, values.ReleaseDate);
  },
});
const handleSubmit = (id:number,Title:string,ReleaseDate:string)=>{
    MovieService().updateMovie({ id: id, Title:Title, ReleaseDate:ReleaseDate})
      .then((response) => {
        console.log("response", response);
        navigate(`/movies/${id}`);
      })
      .catch((e) => {
        postMessage(e.response.data);
      });
  }
return(
    <form onSubmit={formik.handleSubmit}>
      <div>
        <h1>Update Movie</h1>
        <label htmlFor="Title">Title</label>
        <input
          id="Title"
          name="Title"
          type="text"
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
          value={formik.values.Title}
        />
      </div>
      <div>
        <label htmlFor="ReleaseDate">ReleaseDate</label>
        <input
          id="ReleaseDate"
          name="ReleaseDate"
          type="text"
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
          value={formik.values.ReleaseDate}
        />
      </div>
      <button type="submit">Submit</button>
    </form>
);
}
